import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
    margin-top: 1rem;
    padding: 1rem;
    background-color: rgb(235, 195, 64);
    position: fixed;
    bottom: 0;
    left: 0;
    width: 100%;
`;

export default function Footer() {
    return (
        <div>
            
            <Container>
                Hi
            </Container>

        </div>
    )
}
